from typing import List


def util(nums, multipliers, i, j, k, size_nums, size_multipliers, cache):

    if i > j:
        return 0

    if i >= size_nums:
        return 0

    if j < 0:
        return 0

    if k >= size_multipliers:
        return 0

    if (i, j, k) in cache:
        # print('returning for {}, {}, {}'.format(i, j, k))
        return cache[(i, j, k)]

    score1 = nums[i] * multipliers[k] + util(nums, multipliers, i+1, j, k+1, size_nums, size_multipliers, cache)
    score2 = nums[j] * multipliers[k] + util(nums, multipliers, i, j-1, k+1, size_nums, size_multipliers, cache)

    max_score = max(score1, score2)

    cache[(i, j, k)] = max_score

    return max_score


def maximumScore(nums: List[int], multipliers: List[int]) -> int:

    n = len(nums)
    m = len(multipliers)
    print(n, m)
    return util(nums, multipliers, 0, len(nums)-1, 0, len(nums), len(multipliers), {})



def maximumScoreBottomUp(nums: List[int], multipliers: List[int]) -> int:

    n = len(nums)
    m = len(multipliers)
    table = [ [ [0 for _ in range(n)] for _ in range(n)] for _ in range(m+1)]
    for k in range(m-1, -1, -1):
        for l in range(n):
            j = l
            for i in range(n-l):
                if m - k <= j - i + 1:
                    if i == j:
                        table[k][i][j] = multipliers[k] * nums[i]
                    else:
                        table[k][i][j] = max(nums[i] * multipliers[k] + table[k+1][i+1][j], nums[j] * multipliers[k] + table[k+1][i][j-1])

                j += 1

    # print(table)
    return table[0][0][n-1]




